import styled from "styled-components";

const Button = styled.button`
  color: #fff;
  width: 221px;
  height: 45px;
  border: none;
  font-size: 12px;
  margin-top: 30px;
  border-radius: 6px;
  background: #1c4491;
  box-shadow: 0px 0px 50px #0000001a;
`;

export { Button };
